import React, { useState } from 'react'
import Groupbox from './Groupbox'

function Singlegroup() {
    var [group,showGroup]=useState(false);
    let click = ()=>{
      showGroup(true)
    }
  return (
    <>
    <div className='single-group'
    onClick={click}

    >
    <p>
        JavaScript Forum
    </p>
    <p>
        2:30 pm
    </p>
    </div>
    {group && <Groupbox/>}
    </>
  )
}

export default Singlegroup
